import React, { Component } from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
/*-----pages-----*/
import { Home } from "./Home";
import { Home2 } from "./Home2";
import { Home3 } from "./Home3";
import { Home4 } from "./Home4";
import { Home5 } from "./Home5";
import { Home6 } from "./Home6";
import { Homefrelencer } from "./Home-frelencer";
import { Creativecarousel } from "./Creative-carousel";
import { HomeDeveloper } from "./Home-developer";
import { NotFound } from "./404";
import axios from "axios";

class App extends Component {
  state = {
    data: {
      email: "",
      name: "",
      phone: "",
      subject: "",
      message: "",
    },
    submitted: false,
  };

  onChange = (e) => {
    return this.setState({
      data: { ...this.state.data, [e.target.name]: e.target.value },
    });
  };

  onSubmit = () => {
    console.log(JSON.stringify(this.state.data));
    const correctData = {};

    correctData.GuestName = this.state.data.name;
    correctData.Email = this.state.data.email;
    correctData.Phone = this.state.data.phone;
    correctData.MessageTitle = this.state.data.subject;
    correctData.Message = this.state.data.message;

    axios
      .post(
        "https://yvzvk41grl.execute-api.us-east-1.amazonaws.com/v1/contact",
        correctData
      )
      .then(
        (response) => {
          console.log("Response: " + JSON.stringify(response));
        },
        (error) => {
          console.log("Error " + error);
        }
      );
  };



  render() {
    return (
      <React.Fragment>
        <Router>
          <Switch>
            <Route exact path="/" component={Home} />
            <Route path="/Home2" component={Home2} />
            <Route path="/Home3" component={Home3} />
            <Route path="/Home4" component={Home4} />
            <Route path="/Home5" component={Home5} />
            <Route path="/Home6" component={Home6} />
            <Route path="/Home-frelencer" component={Homefrelencer} />
            <Route path="/Creative-carousel" component={Creativecarousel} />
            <Route path="/Home-developer" component={HomeDeveloper} />
            <Route component={NotFound} />
          </Switch>
        </Router>
      </React.Fragment>
    );
  }
}

export default App;
